
from proto import transport

import binascii
import hashlib
import json

from nose import tools

def test_transport():
    msg_hashes = iter('''
             bf0067632603aeaab05da08ec60c9fb9611502afb22a66382d32939b53a97672
             f836c18172fe69d49cb7199bd22ae6691f7ac9fab0646224e042986a2cc3e540
             0f5f25dab154a7ab1a536c8bc53ed7c85cfdfe9dffab639616f059ec2451442b'''.split())

    class sstream(transport.stream):
        def message_received(self, message):
            assert message.raw[:1] == b'['
            assert message.raw[-1:] == b']'
            assert message.raw.find(message.data) != -1
            assert message.company == '3G' 
            assert message.device_id == '3202613806'
            assert hashlib.sha256(message.data).hexdigest() == next(msg_hashes)

    stream = sstream()
    for data in watch_data.split():
        data = data.strip()
        if data:
            stream.send(binascii.unhexlify(data))

def test_limits():
    stream = transport.stream()
    with tools.assert_raises(transport.ProtocolException):
        for i in range(1000):
            stream.send(b'x'*20*1024)
    
    stream = transport.stream()
    with tools.assert_raises(transport.ProtocolException):
        stream.send(b'[3G*6401623106*0001*UU]')

    stream = transport.stream()
    with tools.assert_raises(transport.ProtocolException):
        stream.send(b'3G*6401623106*0001*UU]')

def test_commands():
    from proto import message
    cmd = message.message.from_command('3G', '6401623106', 'FLOWER', u'20', ts='1486372772', direction="server_t")
    cmd2 = message.message.from_command('3G', '6401623106', 'FLOWER', '20', ts='1486372772', direction="server_t")
    assert cmd.crc32() == cmd2.crc32()

    cmd3 = message.message.from_command('3G', '6401623106', 'FLOWER', None, ts='1486372772', direction="server_t")

def test_dynamo():
    msg = {u'direction': {u'S': u'watch'}, u'cmd': {u'S': u'UD'}, u'ts': {u'N': u'1486038045.935960293'}, u'location': {u'M': {u'lat': {u'N': u'55.830853'}, u'lon': {u'N': u'37.6171733'}, u'batt': {u'N': u'79'}, u'type': {u'S': u'A'}, u'ts': {u'N': u'1486038044'}}}, u'data': {u'S': u'020217,122044,A,55.830853,N,37.6171733,E,1.59,254.8,0.0,11,71,79,58698,0,00000000,7,255,250,1,1604,51815,134,1604,51812,136,1603,52464,136,1604,836,133,1604,51816,132,1604,51813,132,1603,52461,131,0,8.8'}, u'device_id': {u'S': u'3G_6401623106'}}

    msg2 = {"cmd":{"S":"FLOWER"},"ts":{"N":"1486137464.19753023"},"device_id":{"S":"3G_6401623106"},"data":{"S":"10"},"direction":{"S":"server"}}

    from proto import message
    m = message.message.from_dynamo(msg)
    assert m.identifier['ts'] == msg['ts']['N']
    assert m.identifier['device_id'] == msg['device_id']['S']
        
    m = message.message.from_dynamo(msg2)

